import React from "react";
import "../css/header.css";

const Header = () => {
  return (
    <div>
      <div id="main-navbar" className="navbar">
        <h2 className="logo">Sand</h2>
        <nav>
          <ul>
            <li>
              <a href="/home">Home</a>
            </li>
            <li>
              <a href="/home">Home</a>
            </li>
            <li>
              <a href="/home">Home</a>
            </li>
            <li>
              <a href="/home">Home</a>
            </li>
          </ul>
        </nav>
      </div>
    </div>
  );
};

export default Header;
